import React from "react";

const Showrombooks = (props) => {
    console.log("tuj", props)
    return (
        <div style={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            backgroundColor: '#f2f2f2',
            padding: '20px',
            borderRadius: '10px',
            boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.2)',
            maxWidth: '500px',
            margin: '0 auto'
        }}>
            <h1 style={{
                fontSize: '24px',
                fontWeight: 'bold',
                marginBottom: '10px'
            }}>{props.show.label}</h1>
            <p style={{
                fontSize: '18px',
                marginBottom: '20px'
            }}>{props.show.abstract}...</p>
            <p style={{
                fontSize: '16px',
                fontStyle: 'italic'
            }}>
                {props.show.authors.length > 1 ? 'Authors: ' : 'Author: '}
                {props.show.authors.join(', ')}
            </p>
        </div>
    );
}

export default Showrombooks;
